export default {
    name: 'c_tab',
    props: {
        name: {
            type: String
        },
        configData:{
            type:null
        }
    },
    data () {
        return {
            formData: {
                type: 0
            },
            defaults: {},
            datas: this.configData,
            upDataGoodList : ''
        }
    },
    watch: {
        configData: {
            handler (nVal, oVal) {
                this.datas = nVal
            },
            deep: true
        }
    },
    mounted () {
        this.$nextTick(()=>{
            // this.datas = this.configData;
            let name = this.$store.state.admin.user.pageName;
            this.upDataGoodList = 'admin/'+name+'/upDataGoodList';
            this.$store.commit(this.upDataGoodList, this.datas.tabConfig.tabVal);
        })
    },
    methods: {
        radioChange (e) {
            this.$emit('getConfig', e);
            this.$store.commit(this.upDataGoodList, e);
        }
    }
}
